const IN_BATTLE = {
  class:       (n: number) => byte(0xd9650 + 0x00 + n * 0x6c),
  appearance:  (n: number) => byte(0xd9650 + 0x01 + n * 0x6c),
  hp:          (n: number) => word(0xd9650 + 0x06 + n * 0x6c),
  affiliation: (n: number) => word(0xd9650 + 0x24 + n * 0x6c),
}

const ADDR = {
  game_state:   byte(0x0db307),
  map_group_id: byte(0x0d34da),
  map_id:       byte(0x0d34de),

  battle_condition_flags: byte(0x0d3a0e),
  battle_condition_flag0: bit0(0x0d3a0e),
  battle_condition_flag1: bit1(0x0d3a0e),

  encounter_id:  word(0x0d915e),
  battle_active: bit0(0x0dbc82),

  event_id: word(0x0bd232),
  music_id: byte(0x0f77fc),
}

set.addAchievement({
  title: 'The Butcher of Port Asyton',
  description:
    'Defeat Arycelle at Port Asyton, after first killing all six of her companions while trying to explain that you are not a mass murderer. Resuming from a mid-battle save is prohibited',
  points: 10,
  type: 'missable',
  conditions: define(
    // Priming
    once(
      cond('AndNext',   prior(ADDR.game_state),      '!=', 0x50),
      cond('AddSource', ADDR.map_group_id,           '*',  0x100),
      cond('AndNext',   ADDR.map_id,                 '=',  0x02),
      cond('AndNext',   ADDR.battle_condition_flag0, '=',  0),
      cond('AndNext',   ADDR.battle_condition_flag1, '=',  0),
      cond('AndNext',   ADDR.encounter_id,            '=', 0x1c),
      cond('',          ADDR.battle_active,           '>', prev(ADDR.battle_active))
    ),

    // Trigger conditions
    ...range(1, 19).map((n) => define(
      cond('AndNext', IN_BATTLE.affiliation(n), '=',  3),
      cond('AndNext', IN_BATTLE.appearance(n),  '!=', 0x54),
      cond('AndNext', prev(IN_BATTLE.hp(n)),    '>',  0),
      cond('AddHits', IN_BATTLE.hp(n),          '=',  0),
    )),
    cond('AndNext', IN_BATTLE.affiliation(19), '=',  3),
    cond('AndNext', IN_BATTLE.appearance(19),  '!=', 0x54),
    cond('AndNext', prev(IN_BATTLE.hp(19)),    '>',  0),
    cond('Trigger', IN_BATTLE.hp(19),          '=',  0, 6),

    trigger(
      andNext(
        neq(prev(ADDR.event_id), 0x9a),
        eq(ADDR.event_id, 0x9a)
      )
    ),

    // Reset conditions
    ['ResetIf', 'Mem', '8bit', 0xdb307, '!=', 'Value', '', 0],
    ['AddSource', 'Mem', '8bit', 0xd34da, '*', 'Value', '', 256],
    ['ResetIf', 'Mem', '8bit', 0xd34de, '!=', 'Value', '', 2],
    ['ResetIf', 'Mem', '16bit', 0xd915e, '!=', 'Value', '', 28],
    ['ResetIf', 'Mem', '8bit', 0xf77fc, '=', 'Value', '', 4],
    ['ResetIf', 'Mem', '8bit', 0xf77fc, '=', 'Value', '', 5],
    ['AndNext', 'Delta', '16bit', 0xbd232, '=', 'Value', '', 154],
    ['ResetIf', 'Mem', '16bit', 0xbd232, '=', 'Value', '', 154],
  ),
  badge: '504659',
  id: 437052,
});


